-- Criar tabela

CREATE TABLE [Parâmetros dos endpoints] (
    Id INT NOT NULL PRIMARY KEY,

    ApiEndpointId INT NOT NULL,
    ParameterId INT NOT NULL,
    Required INT NOT NULL,

    CONSTRAINT FK_ParametrosDosEndpoints_Endpoint FOREIGN KEY (ApiEndpointId)
        REFERENCES [Endpoints da API](Id),

    CONSTRAINT FK_ParametrosDosEndpoints_Parameter FOREIGN KEY (ParameterId)
        REFERENCES Parameters(Id)
);

